const DisplayComponent = ({time}) => {
  
  return (
    <div>
      
       <span>{(time >= 10)? time : "0"+ time}</span>:
       <span>{(time >= 10)? time : "0"+ time}</span>:
       <span>{(time >= 10)? time : "0"+ time}</span>
       
    </div>
  );
}

export default DisplayComponent;
